import data from "../json/painting.json";
import { Counter } from "./Counter";
import { Card } from "./Card";

export const App = () => {
  return (
    <div>
      <Counter />
      <Card
        url={data[0].url}
        title={data[0].title}
        // authorName={data[0].author.tag}
        // profileUrl={data[0].author.url}
        price={data[0].price}
        quantity={data[0].quantity}
      />

      <Card
        url={data[1].url}
        title={data[1].title}
        // authorName={data[1].author.tag}
        // profileUrl={data[1].author.url}
        price={data[1].price}
        quantity={data[1].quantity}
      />
    </div>
  );
};
